# load in dataset
df = pd.read_csv('data/CareyCarlson/CC_raw.csv')
reformated_df = pd.DataFrame(
    columns=['RECEPTOR', 'odorant', 'SMILES', 'output', 'Protein sequence']
)

# loop through rows
for i, (_, row) in enumerate(df.iterrows()):
    # add to new csv
    for j, receptor in enumerate(row.keys()[1:]):
        reformated_df = pd.concat(
            [
                reformated_df,
                pd.DataFrame({
                    'RECEPTOR': receptor,
                    'odorant': row['odorant'],
                    'SMILES': Chem.MolToSmiles(Chem.MolFromSmiles(smiles[row['odorant']])),
                    'output': row[receptor],
                    'Protein sequence': receptors[receptor]
                }, index=[j + i*len(row)])
            ],
            ignore_index=True
        )

# save csv
reformated_df.to_csv('data/CareyCarlson/CC_reformat.csv', index=False)
